ad_creative_bodies:
Câteva gânduri la ceas de seară! Cum îmi vin, fără legătură! 
- în campanie fiind am făcut la picior 80% din oraș! Este o cocină, la propriu! Să mă scuzați, o spun cu tristețe! Noroaie, mizerie nemăturată de luni de zile sau măturată și lăsată pe stradă în zeci de grămăjoare, spațiul verde distrus de mașinile care nu mai au unde parca, gropi, hârtoape, agresori. Trist, trist rău;
- PSD și PNL au scos sute de oameni îmbrăcați în culorile "tradiționale" doar ca să se plimbe prin oraș! Ca șenilatele! Nicio interacțiune cu oamenii, nicio întrebare, niciun salut, niciun scuipat. Trist, trist rău. VC a făcut poze și a plecat într-o oră. Treburile urbei l-au chemat degrabă înapoi în Eforie. Haios;
- Simion nu intră în turul 2. Țin pariul cu oricine! Dacă totuși intră, îl votez. Nu am nicio problemă că nu e Ciolacu și e Simion, să se învețe minte PSD să mai crească pesediști mici  sub acoperire; 
- nici Lasconi nu intră în turul 2. Îmi pare rău că a fost sacrificată de USR;
- care mai credeți că PSD și PNL nu o să mai facă echipă după alegeri  ...uitați-vă la Constanța! Cele 2 partide s-au înțeles deja să dea fiecare câte un viceprimar. Cu încălcarea legii, dar când a contat legea pentru PSD și PNL?
- cei de v-ați lăsat plăcut impresionați de maimuțărelile AUR la CT ... luați act că săritul în băltoaci, cățăratul în pomi și mâncatul de parizer au fost doar așa, de impresie artistică. AUR la Constanța mai au fost puțin până să îi facă un dans în poală lui VC;
- una peste alta la CT AUR e un partid ratat, care cu resurse de 100 de ori mai mari decât ale mele, de toate felurile ( bani, oameni, relații ..)  a luat doar dublul voturilor mele; 
- una peste alta, sunt singurul consilier local care și-a luat voturile pe CNP și nu în spatele unei sigle de partid. ȘI cu siguranță am obținut mai multe voturi decât oricare alt consilier de la oricare alt partid. Doar împărțiți numărul total de voturi pe partid la numărul de consilieri ai fiecărui partid și vă veți emoționa. 
Epilog ( gen):  nu uit niciodată nici de unde am plecat și nici respectul și considerația altora. Nu uit pentru ce am fost trimisă în consiliul local. Nu promit că vom izbândi, promit însă că vor dormi tare prost în următorii 4 ani. Toți, de la primul la ultimul. 
Evident, mă aștept la contraofensivă pe toate planurile. Va fi ce vrea Dumnezeu. 
Dacă dați un vot pentru parlament ... iese și mai bine, că ai alte pârghii ca parlamentar. Mai multe și mai puternice. Iar răul vine tot de la București. 
Hai, să fiți iubiți!
CMF 11240046
